(165350, '460056FD-ED0E-4F81-9109-EE3B32D573C0', 'Some midday thoughts: I know you''re working so hard, against a lot of yucky dynamics. I''m proud of you for staying cool when things get rough. And for focusing on solutions that are within your control. I think the way you handled Nathan this morning was really well done.  Loved spending the last two weeks with you. Having you revel in all the great learning at Ren weekend was also really fun for me. So glad to be helping to put you in environments where you get to build on your natural curiosity. And I can''t even tell you how meaningful it was for you to spend time getting to know my family. And all the weird dynamics that come from my world.   You''re a bedrock of love and goodness in my life and I love you with all my heart. ', '473631362000000000', '473631411000000000', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'None', 'nitzan.pelman@gmail.com', '2016-01-04T12:16:02'),
